My Pregnancy is a week-by-week pregnancy tracker. Our app will help you over the course of your pregnancy. Stay on top of the changes happening inside your body. Find out how your baby is developing.

Our app is completely free and does not contain advertising.

This app includes:
- week-by-week advice;
- useful information on fetal development and changes in your body;
- week-by-week fetal measurements and imaging;
- a to-do list for each trimester;
- a list of things you will need for hospital check-in, post-natal care and check-out;
- a weight tracker you can use to follow weight gain;
- a kick counter;
- a contraction timer;
- and much more

We have created this app with love, specially for young mothers.

This app is not intended for medical use and is not a substitute for medical consultation.

If you have any questions or requests, please write to neumandev@gmail.com. We are eager to hear your comments on how to improve the app.

Upozornenie: Časti tejto aplikácie sú určené pre zdravotníckych pracovníkov ako nástroj na podporu rozhodovania. Nie je určená na používanie pacientmi a nenahrádza rady lekára.

Mediately Mediately Databáza Liekov — Mobilný asistent pre rýchlejšiu diagnostiku a liečbu, odteraz aj na vašom iPhone a iPade.

Vďaka aplikácii môžete jednoducho vyhľadávať v offline registri liekov s viac ako 9.600 liekmi a získať okamžitý prístup k interaktívnym klinickým nástrojom a dávkovacím kalkulačkám.

1. Získajte informácie o viac ako 9.600 liekoch

Pri každom lieku si môžete zobraziť podrobné informácie vrátane:

• Základných informácií o lieku (účinná látka, zloženie, lieková forma, trieda, informácie o úhrade lieku zo systému verejného zdravotného poistenia);
• Dôležitých informácií z dokumentu SmPC pre daný liek (indikácie, dávkovanie, kontraindikácie, interakcie, vedľajšie účinky, predávkovanie atď.);
• Klasifikácie ATC a paralelné lieky;
• Balenia a ceny;
• Prístupu ku kompletnému dokumentu SmPC vo formáte PDF (vyžaduje pripojenie na internet).

2. Vyhľadávajte v rozsiahlej ponuke interaktívnych diagnostických nástrojov

Okrem kompletnej databázy liekov aplikácia obsahuje množstvo interaktívnych klinických nástrojov a dávkovacích kalkulačiek užitočných v každodennej praxi:

• CHA2DS2-VASc (Score for Atrial Fibrillation Stroke Risk, skórovací systém pre stratifikáciu rizika CMP u pacientov s fibriláciou predsiení);
• GCS (Glasgow Coma Scale, škála hodnotiaca kvantitatívnu poruchu vedomia u dospelých);
• GFR (odhad glomerulárnej filtrácie podľa rovnice MDRD);
• HAS-BLED (skórovací systém na stanovenie rizika závažného krvácania u pacientov s fibriláciou predsiení);
• MELD (Model for End-Stage Liver Disease, skórovací systém používaný na hodnotenie závažnosti chronických ochorení pečene);
• PERC skóre (Pulmonary Embolism Rule-out Criteria, skórovací systém kritérií pre vylúčenie pľúcnej embólie);
• Wellsove kritériá pre pľúcnu embóliu.

Objavte nástroje, ktoré denne používajú tisíce lekárov.

3. CME (Vzdelávanie)

Prehĺbte svoje vedomosti a získajte kredity CME z pohodlia vášho domova alebo kancelárie.

• Prečítajte si článok alebo si pozrite video, ktoré vás zaujme.
• Prehľad tém je neustále aktualizovaný, aby ste získali užitočné poznatky z vášho odboru.

Aplikácia obsahuje aj klasifikáciu chorôb podľa MKCH-10 a klasifikačný systém ATC. Pravidelne ju aktualizujeme, aby ste mali vždy k dispozícii najnovšie informácie.

Táto aplikácia je registrovaná a regulovaná slovinským Úradom pre kontrolu liečiv a zdravotníckych pomôcok a je označená značkou CE ako zdravotnícka pomôcka. Spoločnosť Modra Jagoda d.o.o. je držiteľom certifikátu ISO 13485 certifikácie systému managementu kvality zdravotníckych pomôcok.

ANATOMIA – SUPERA 

Este é um aplicativo de realidade aumentada, desenvolvido em 3D, que explora a anatomia do corpo humano. 

Destinado, com exclusividade, para uso de médicos em seus estudos e elucidações sobre a estrutura dessa articulação.

Para visualizar os modelos em realidade aumentada, deve-se baixar este aplicativo e posicionar a câmera do celular ou tablet na imagem “ANATOMIA – PÉ", impressa na frente da lâmina (física) de ARCOXIA, previamente entregue aos médicos.

Com navegação intuitiva, a interação se dá de forma simples (obrigatoriamente a partir da leitura da lâmina física), por meio deste aplicativo:

- Posicione a câmera do celular ou tablet na imagem “ANATOMIA - PÉ";

– O ícone em formato de losango, no topo da tela, ativa e desativa as legendas, ocultas nos pontos inseridos em cada imagem;

– As setas ajudam a navegar entre as imagens;

– Tanto o zoom quanto a rotação das imagens são feitos por meio de toques na tela.

Tudo muito fácil e prático!

The simplest program to track breastfeeding, pumping, bottle feeding, solid food consumption, diapers, sleep schedule, height and weight, and more.

With the click of a button, your feedings and baby care history will be stored in the app. You will have an easy-to-maintain history of your baby’s growth.

The birth of a baby is a miracle that fills your heart with joy! A mother’s life changes dramatically with the birth of her baby. It is so important for a mother and her newborn baby to establish a comfortable breastfeeding relationship.  Moms need to keep track of which breast to offer her baby, how long the baby suckles at each breast, the number of times the baby breastfeeds each day, how many wet diapers and bowel movements the baby has, how long and frequently the baby sleeps, as well as the baby’s weight and growth.  All of this information is important for the self-assessment of breastfeeding and for assessing the growth of the child.  Having this information easily accessible will be extremely useful when visiting with your pediatrician or lactation consultant.

It is important to record all of this data. Do not rely on your memory, because even the most organized mothers are often lost in the sea of information about their newborn.

Use the features of the Breastfeeding application.

Breastfeeding and pumping:
- record the time and quantity of feedings and/or pumpings;
- note which breast was fed or pumped last to ensure starting new feeding/pumping on the opposite breast;
- record the duration of feeding/pumping;
- pause feeding/pumping, if necessary;
- quickly add feeding/pumping session that was similar to the most recent but updates with the current time
- use the maximum duration of feeding setting and the application will stop recording the feeding/pumping at the set time if you are unable to press stop

Liquids:
- consider all of your child’s fluid intake (water, expressed breast milk, formula, juice, etc.);
 -track your child’s reactions to new fluids and leave comments for yourself and other caregivers;
- set the default fluid volume (can be edited as needed);

Feeding (solid food):
- add solid foods as your child begins eating them (cereal, vegetables, fruits, meat, fish);
- track your child’s reactions to these new foods and leave comments for yourself and other caregivers
- set the default fluid volume (can be edited as needed);

Sleep:
- record the time and duration of your baby’s sleep each day so you can better plan your day;
- compare your baby’s sleep habits with recommended sleep guidelines

Diapers: 
- track the number of your baby’s wet and/or dirty diapers. This information is crucial for noticing signs of dehydration, constipation, and diarrhea and alerting the child’s pediatrician if necessary.

Measurements: 
- track height and weight to evaluate your baby’s development;

Other features:
- edit or delete events as needed;
- set reminders for various events; 
- use the application in your native language;
- select your preferred units of measurement;
- view statistics;
- enter data for several children and twins;
- backup all of your data;

Also available in PRO-version:
- disable advertising;	
- auto backup every 24 hours;	
